Node* upperBoundOf(Node* root, int key) {
    if (root == nullptr || key == root->value) return root;

    if (key < root->value) {
        return upperBoundOf(root->left, key);
    } else if (key > root->value) {
        Node* result = upperBoundOf(root->right, key);
        if (result == nullptr) {
            return root;
        } else {
            return result;
        }
    }
}

struct Node {
    int value;
    Node* left;
    Node* right;
};
